package com.etrack.myapplication.model.inputService;import com.google.gson.annotations.Expose;import com.google.gson.annotations.SerializedName;/** * Created by Hussain on 01-04-2018. */public class SaveItem {    @SerializedName("objitem")    @Expose    private SaveObjitem objitem;    public SaveObjitem getObjitem() {        return objitem;    }    public void setObjitem(SaveObjitem objitem) {        this.objitem = objitem;    }    public class SaveObjitem {            @SerializedName("item_code")            @Expose            private String itemCode;            @SerializedName("item_barcode")            @Expose            private String itemBarcode;            @SerializedName("item_name_en")            @Expose            private String itemNameEn;            @SerializedName("item_name_ar")            @Expose            private String itemNameAr;            @SerializedName("category_code")            @Expose            private String categoryCode;            @SerializedName("unit_price")            @Expose            private String unitPrice;            @SerializedName("sales_price")            @Expose            private String salesPrice;            @SerializedName("cost_price")            @Expose            private String costPrice;            @SerializedName("opening_quantity")            @Expose            private String openingQuantity;            @SerializedName("discount")            @Expose            private String discount;            @SerializedName("company_id")            @Expose            private String companyId;            public String getItemCode() {                return itemCode;            }            public void setItemCode(String itemCode) {                this.itemCode = itemCode;            }            public String getItemBarcode() {                return itemBarcode;            }            public void setItemBarcode(String itemBarcode) {                this.itemBarcode = itemBarcode;            }            public String getItemNameEn() {                return itemNameEn;            }            public void setItemNameEn(String itemNameEn) {                this.itemNameEn = itemNameEn;            }            public String getItemNameAr() {                return itemNameAr;            }            public void setItemNameAr(String itemNameAr) {                this.itemNameAr = itemNameAr;            }            public String getCategoryCode() {                return categoryCode;            }            public void setCategoryCode(String categoryCode) {                this.categoryCode = categoryCode;            }            public String getUnitPrice() {                return unitPrice;            }            public void setUnitPrice(String unitPrice) {                this.unitPrice = unitPrice;            }            public String getSalesPrice() {                return salesPrice;            }            public void setSalesPrice(String salesPrice) {                this.salesPrice = salesPrice;            }            public String getCostPrice() {                return costPrice;            }            public void setCostPrice(String costPrice) {                this.costPrice = costPrice;            }            public String getOpeningQuantity() {                return openingQuantity;            }            public void setOpeningQuantity(String openingQuantity) {                this.openingQuantity = openingQuantity;            }            public String getDiscount() {                return discount;            }            public void setDiscount(String discount) {                this.discount = discount;            }            public String getCompanyId() {                return companyId;            }            public void setCompanyId(String companyId) {                this.companyId = companyId;            }    }}